const InputSide = () => {
    return (
        <>
            <section className="flex pt-40 justify-center">
                <label className="block text-gray-700 text-sm font-bold mb-2">
                    Name <br />
                </label>
                <input name="name" className="shadow-md rounded px-4 pt-3 pb-4 mb-4"/>
            </section>
        </>
    )
}

export default InputSide
